import React, { createContext } from "react";
import { NavLink } from "react-router-dom";
import service1 from "../../images/service-1.webp";
import service2 from "../../images/service-2.webp";
import service3 from "../../images/service-3.webp"; 
import "./services.css";
import BookNow from "./BookNow";

const Services = () => {

  const Service = createContext();
  const Timing = createContext();
  const Price = createContext();


  const services = [
    {
      img: service1,
      serviceName: "PROJECT MANAGEMENT",
      time: "1 hr",
      fees: "$220",
      btn: "Book Now",
    },
    {
      img: service2,
      serviceName: "OPERATIONAL CONSULTING",
      time: "1 hr",
      fees: "$170",
      btn: "Book Now",
    },
    {
      img: service3,
      serviceName: "CORPORATE STRATEGY",
      time: "1 hr",
      fees: "@150",
      btn: "Book Now",
    },
  ];

  return (
    <Service.Provider>
      <Timing.Provider>
        <Price.Provider>

        </Price.Provider>
      </Timing.Provider>
    </Service.Provider>
  );
};

export default Services;
